import styled from "styled-components";
import Contents from "./swiper.component";

const Wrapper = styled.div`
    color: white;
`

const ContentsBox = () => {
    return (
        <Wrapper>
            <Contents/>
        </Wrapper>
    )
}

export default ContentsBox;
